class Solution:
    def findSubstring(self, s, words):
        """
        :type s: str
        :type words: List[str]
        :rtype: List[int]
        """
        if s == "" or s == None or words == None or len(words)==0:
            return []
        
        dict = {}
        result = []
        for word in words:
            dict[word] = 1
            
        step = len(words[0])
        totallenth= step * len(words)
        
        for i in range(len(s)-totallenth+1):
            newList = []
            for j in range(len(words)):
                temp = s[i + step * j : i+step*(j+1)]
                if dict.get(temp) == None:
                    break
                else:
                    newList.append(temp)
        
            if self.isSame(newList, words):
                result.append(i)
            
        return result
    
    def isSame(self, newList, words):
        if len(newList) != len(words):
                return False
        a = sorted(newList)
        b = sorted(words)
        flag = True
        
        for i in range(len(a)):
            if a[i] != b[i]:
                return False
        return flag
        
        
